void ResetProtocol(){
    SBAPI->gfx.initdisplay(220, FPS_50hz);	// 60fps landscape mode
	SBAPI->gfx.displaymode(480, 320, 480, 320, DISPFLAG_DEFAULTS);	// the big bitmap is double the height
	
   	CLUTAlpha(titleclut32);
    ShowBuffer(0);
	SBAPI->gfx.clearBackLayerBuffer(0);
    ShowBuffer(1);
	SBAPI->gfx.clearBackLayerBuffer(0);
	SBAPI->gfx.clut(clut, 0);	// back ground
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();

	SBAPI->gfx.clut(clut, 1);	// fore ground
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
    SBAPI->gfx.waitvsync();
	
    
    IMGtoBG(rebooticon);
	SBAPI->gfx.render(0x01);
	SBAPI->gfx.waitvsync();
	SBAPI->gfx.render(0x01);


    SBAPI->gfx.setBacklightBrightness(255);	// turn off backlight


    while(1);
}